                <header className={props.clearDisplay ? "clearDisplay" : props.headerCssPassed}>
                    <HeroHeading takeTestButtonClicked={props.takeTestButtonClicked}/>
                </header>
            </div>
        </div>
    );
}
export default HeroHeader;
